import React from 'react';
import '../../App.js'
import Footer from '../Footer.js';
/*import MyDashboard from '../ShinyDashbaordComponent.js';*/

const MyDashboard = () => {
  return (
    <div>
      <h1>My Dashboard</h1>
      <iframe
        title="R Markdown Dashboard"
        src="/Dash.html" // Update this with the actual path to your HTML file
        width="100%"
        height="600px"
      />
    </div>
  );
};


export default function Rproj() {
    return (
    <>
    <h1 className='Rproj'>R Projects</h1>
    <p>here</p>
    < MyDashboard/>
    < Footer/>
    </>);
  }
